  ngOnInit(): void {
    const logueado = localStorage.getItem('usuario_logueado') === 'true';
  const userId = localStorage.getItem('usuario_id');
  const userEmail = localStorage.getItem('usuario_email');

  if (logueado && userId) {
    this.usuarioActual = {
      _id: userId,
      email: userEmail
    };
  } else {
    this.usuarioActual = null;
  }

    this.formData.productos = [{ categoria: '', equipo: '', cantidad: 1 }];

    this.obtenerUltimoNumero();
    this.cargarCategoriasYEquipos();

    const productosGuardados = localStorage.getItem('productos_cotizacion');
    if (productosGuardados) {
      this.formData.productos = JSON.parse(productosGuardados);
      localStorage.removeItem('productos_cotizacion');
    } else {
      const carrito = this.carritoService.obtenerCarrito();
      if (carrito.length > 0) {
        this.formData.productos = carrito.map(p => ({
          categoria: p.category || '',
          equipo: p.name || '',
          cantidad: p.cantidad || 1
        }));
      }
    }

    if (this.formData.productos.length === 0) {
      this.formData.productos.push({ categoria: '', equipo: '', cantidad: 1 });
    }

    this.formData.productos.forEach((_p, i) => {
      this.dropdownAbiertoCategoria[i] = false;
      this.dropdownAbiertoEquipo[i] = false;
      this.categoriaBusqueda[i] = '';
      this.equipoBusqueda[i] = '';
    });
  }

  obtenerUltimoNumero(): void {
    this.http.get<{ total: number }>('https://backend-dinsac-hlf0.onrender.com/cotizaciones/total')
      .subscribe({
        next: (res) => {
          this.ultimoNumero = res.total;
          this.numeroGenerado = `COT-${(this.ultimoNumero + 1).toString().padStart(8, '0')}`;
        },
        error: () => {
          this.numeroGenerado = `COT-${new Date().getTime().toString().slice(-8)}`;
        }
      });
  }

  cargarCategoriasYEquipos(): void {
    this.productService.getProducts().subscribe({
      next: (products) => {
        this.productosList = products;
        this.categorias = [...new Set(products.map(p => p.category))].sort();
        this.equipos = [...new Set(products.map(p => p.name))].sort();
      },
      error: () => {
        this.categorias = [
          'Herramientas y Equipos',
          'Maquinaria y Motores',
          'Sistemas de Agua y Bombeo',
          'Construcci√≥n e Industria',
          'Agro y Jardiner√≠a',
          'Limpieza y Hogar',
          'Procesamiento de Alimentos'
        ];
      }
    });
  }

  getCategoriasFiltradas(i: number): string[] {
    const q = (this.categoriaBusqueda[i] || '').toLowerCase();
    return this.categorias.filter(c => c.toLowerCase().includes(q));
  }

  getEquiposFiltrados(categoria: string, busqueda: string = ''): string[] {
    const q = (busqueda || '').toLowerCase();
    return this.productosList
      .filter(product => product.category === categoria && product.name.toLowerCase().includes(q))
      .map(product => product.name)
      .sort();
  }

