  onSubmit(): void {
    this.generarPDF();
  }



private validarFormulario(): boolean {
  const f = this.formData;

  // üîπ Validar nombre
  if (!f.nombre.trim()) {
    alert('‚ö†Ô∏è El nombre es obligatorio.');
    return false;
  }

  // üîπ Validar DNI o RUC
  if (!f.dniRuc.trim()) {
    alert('‚ö†Ô∏è Debes ingresar tu DNI o RUC.');
    return false;
  }

  // üîπ Validar email con expresi√≥n regular
  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!f.email.trim() || !emailRegex.test(f.email)) {
    alert('‚ö†Ô∏è Ingresa un correo electr√≥nico v√°lido.');
    return false;
  }

  // üîπ Validar tel√©fono m√≥vil (solo n√∫meros y exactamente 9 d√≠gitos)
  const telefonoRegex = /^[0-9]{9}$/;
  if (!f.telefonoMovil.trim() || !telefonoRegex.test(f.telefonoMovil)) {
    alert('‚ö†Ô∏è Ingresa un n√∫mero de tel√©fono v√°lido de 9 d√≠gitos.');
    return false;
  }

  // üîπ Validar contacto
  if (!f.contacto.trim()) {
    alert('‚ö†Ô∏è Debes indicar una forma de contacto (ej. WhatsApp, llamada, correo, etc.).');
    return false;
  }

  // üîπ Validar productos
  if (!f.productos.length) {
    alert('‚ö†Ô∏è Debes agregar al menos un producto a la cotizaci√≥n.');
    return false;
  }

  for (let p of f.productos) {
    if (!p.categoria || !p.equipo || p.cantidad <= 0) {
      alert('‚ö†Ô∏è Verifica que todos los productos tengan categor√≠a, equipo y cantidad v√°lidos.');
      return false;
    }
  }

  return true; // ‚úÖ Todo v√°lido
}


