  private limpiarFormulario(): void {
    this.formData = {
      nombre: '',
      dniRuc: '',
      email: '',
      telefonoMovil: '',
      mensaje: '',
      contacto: '',
      terminos: false,
      productos: [{ categoria: '', equipo: '', cantidad: 1 }]
    };
  }

  // M√©todos de manejo de dropdowns
  private ensureIndices() {
    const len = this.formData.productos.length;
    for (let i = 0; i < len; i++) {
      if (this.dropdownAbiertoCategoria[i] === undefined) this.dropdownAbiertoCategoria[i] = false;
      if (this.dropdownAbiertoEquipo[i] === undefined) this.dropdownAbiertoEquipo[i] = false;
      if (this.categoriaBusqueda[i] === undefined) this.categoriaBusqueda[i] = '';
      if (this.equipoBusqueda[i] === undefined) this.equipoBusqueda[i] = '';
    }
  }

  toggleCategoria(i: number) {
    this.ensureIndices();
    this.dropdownAbiertoCategoria[i] = !this.dropdownAbiertoCategoria[i];
    if (this.dropdownAbiertoCategoria[i]) this.dropdownAbiertoEquipo[i] = false;
  }

  toggleEquipo(i: number) {
    this.ensureIndices();
    this.dropdownAbiertoEquipo[i] = !this.dropdownAbiertoEquipo[i];
    if (this.dropdownAbiertoEquipo[i]) this.dropdownAbiertoCategoria[i] = false;
  }

  selectCategoria(i: number, categoria: string) {
    const prod = this.formData.productos[i];
    prod.categoria = categoria;
    prod.equipo = '';
    this.dropdownAbiertoCategoria[i] = false;
    this.categoriaBusqueda[i] = '';
  }

  selectEquipo(i: number, equipo: string) {
    const prod = this.formData.productos[i];
    prod.equipo = equipo;
    this.dropdownAbiertoEquipo[i] = false;
    this.equipoBusqueda[i] = '';
  }

  countProductsInCategory(category: string): number {
    return this.productosList.filter(p => p.category === category).length;
  }

  agregarProducto(): void {
    this.formData.productos.push({ categoria: '', equipo: '', cantidad: 1 });
    this.ensureIndices();
  }

  quitarProducto(i: number): void {
    if (this.formData.productos.length > 1) {
      this.formData.productos.splice(i, 1);
      this.dropdownAbiertoCategoria.splice(i, 1);
      this.dropdownAbiertoEquipo.splice(i, 1);
      this.categoriaBusqueda.splice(i, 1);
      this.equipoBusqueda.splice(i, 1);
    }
  }
